using core_strength_yoga_products_api.Data.Contexts;
using core_strength_yoga_products_api.Model;
using core_strength_yoga_products_api.Models;
using core_strength_yoga_products_api.Models.Enums;
using Microsoft.EntityFrameworkCore;

namespace core_strength_yoga_products_api.Data
{
    public static class SeedData
    {
        public static void Initialize(IServiceProvider serviceProvider)
        {
            using (var context = new CoreStrengthYogaProductsApiDbContext(
            serviceProvider.GetRequiredService<
                DbContextOptions<CoreStrengthYogaProductsApiDbContext>>()))
            {
                context.Database.EnsureCreated();

                if (context.Products.Any())
                {
                    return;
                }

                var equipmentImage = new Image(
                    id: 1,
                    imageName: "Equipment",
                    alt: "Image of Equipment",
                    path: ""
                );
                
                var clothingImage = new Image(
                    id: 2,
                    imageName: "Clothing",
                    alt: "Image of Clothing",
                    path: ""
                );
                
                var matBlueImage = new Image(
                    id: 3,
                    imageName: "yoga-mat-1",
                    alt: "Image of Blue Yoga mat",
                    path: ""
                );
                
                var matMultiImage = new Image(
                    id: 4,
                    imageName: "Multi color Mat",
                    alt: "Image of Multi Colour Yoga mat",
                    path: ""
                );

                var productEquipmentType = new Models.ProductType(
                    id: 1,
                    productTypeName: "Equipment",
                    description: "Our Selection of Equipment",
                    image: equipmentImage
                );
                    var productClothingType = new Models.ProductType(
                    id: 2,
                    productTypeName: "Clothing",
                    description: "Our Selection of Clothing",
                    image: clothingImage
                );

                var productMatCategory = new Models.ProductCategory(
                    id: 1,
                    productCategoryName: "Mats",
                    description: "Our Selection of Mats"
                );
                productMatCategory.Image = equipmentImage;

                var productAttribute = new ProductAttributes(
                    id: 6,
                    stockLevel: 10,
                    priceAdjustment: 0,
                    colour: Colour.Red,
                    size: Size.M,
                    gender: Gender.Unisex
                );
                //context.ProductAttributes.Add(productAttribute);
                //context.SaveChanges();

                var product = new Product(
                    id: 1,
                    name: "Bog Standard Yoga Mat",
                    description: "The worst yoga mat you have ever seen",
                    fullPrice: 30m
                );
                product.ProductType = productEquipmentType;
                product.ProductCategory = productMatCategory;
                product.Image = matBlueImage;
                product.ProductAttributes = new List<ProductAttributes> { productAttribute };

                context.ProductTypes.Add(productClothingType);
                context.ProductTypes.Add(productEquipmentType);
                context.Products.Add(product);
                context.SaveChanges();
            }
        }
    }
}
